def transformer_part1(
    token_position: int,
    head: int,
    head_size: int,
    key_cache_layer: List[List[int]],
    q: List[int],
) -> List[int]:
    return matrix_vec_mul(
        matrix_col_slice(
            matrix_row_slice(key_cache_layer, 0, token_position),
            head * head_size,
            (head + 1) * head_size,
        ),
        vec_slice(q, head * head_size, (head + 1) * head_size),
    )
